class Solution:
    def findMinDifference(self, timePoints):
        if not timePoints:
            return None
        min_diff = 24 * 60 + 1
        times = []
        for timePoint in timePoints:
            hours,mins = timePoint.split(':')
            mins = int(mins)
            hours = int(hours)
            time = hours * 60 + mins
            times.append(time)
            if hours < 12:
                times.append(time + 24 * 60)
        times.sort()
        for i in range(1, len(times)):
            min_diff = min(times[i] - times[i - 1], min_diff)
        return min_diff

